import React, { useContext } from "react";
import './Create_Join_Table.css'
import { Context } from "../helpers/Contexts";

function Create_Join_Table(){
    const navigate=useNavigate();
    const goToCreateJoinTable=()=>{
      navigate('/create_join_table');
    }
    return(
        <div className="create_body_block">
            <div className="create_block">
                <button className="create_button" onClick={()=>{setPageState("table_setting")}}>Create Table</button>
            </div>

            <div className="join_block">
                <input type="number" id="input_code" placeholder="Enter code"/>
                <button className="join_button" onClick={()=>{setPageState("table_setting")}}>Join Table</button>
            </div>
        </div>
    );
}
export default Create_Join_Table;
